import React,{useState} from 'react';
import {useNavigate} from 'react-router-dom';
import './login.css'
import {AiOutlineEye,AiOutlineEyeInvisible} from 'react-icons/ai';
import axios from 'axios';
const Login = () => {
  const Navigate=useNavigate();
  const [state,setstate]=useState(false);
  const tooglebtn = ()=>{
    setstate(prevState=>!prevState);  
    const Authorise=()=>{
      {axios({
        url: "http://localhost:3000/",
        method: "POST",
        headers: {

        },
        state: {email: state.email, password: state.password}
    }).then((res) => {
  
         Navigate("/");
         console.log(res);
        
        
    }).catch((err) => {
        console.log(err)
    })
    }
  }
  }
  return (

    <div className='login_container'>
      <div className='login'>
        
        <h1 className='loginh1'>Logo</h1> <br/>
        <p>Enter your credentials to access your account</p> <br/>
         <input type='text' id='userid' placeholder='User ID'/>
         <div className='input-element-wrapper'>
        <input type={state ? "text": "password"} id='passwordLI' placeholder='Password'/> 
        <button className='btn' onClick={tooglebtn}>
           {state ? <AiOutlineEye/> : <AiOutlineEyeInvisible/>}
          </button>
        </div>
        <button className='signinbtn' onClick={Authorise}>Sign In</button> <br/>

        <p onClick={() => { Navigate("/signup") }} className='signuptext' >Sign Up</p> 
       
      </div>
      <p className='footer'>Don't have an account? SignUp</p>
      </div>
  
  )
}

export default Login;
